The boys at Engine 22, &quot;the Fighting 22&quot; (aka the O'Wheeley Grenadiers) have just come back from a big job and are feeling down and out about it. Having to deal with burned buildings, devastating loss and misery 24/7 has taken its toll on these heroes. When Fire Chief Franky O'Funnigan sees this, he decides to call in the big guns to boost morale: rookie firefighter Emily B. Soon enough she has the boys up and cheery, ready to put out her busty blaze with a hosedown of the sticky stuff.
